import React, { useEffect } from "react";

export default function CustomHooks() {
  useEffect(() => {
    fetch("https://fakestoreapi.com/products")
      .then((response) => response.json()) // Correction : ajouter les parenthèses pour exécuter json()
      .then((data) => {
        console.log("Produits :", data); // Correction : améliorer la lisibilité
      })
      .catch((error) => {
        console.error("Erreur lors de la récupération des produits :", error);
      });
  }, []);

  return <div>Custom Hooks Component</div>; // Correction : Retourner un élément JSX
}
